import { Link } from "react-router-dom";
import Header from "../components/Header";
import { useState } from 'react';
import Open from '../components/Open';
import DateRangeForm from "../components/DateRangeForm";
import axios from "axios";


const ChartSpend = (props) => {

    const sessionEmail = localStorage.getItem("email");
    const [costs, setCosts] = useState({});

    useEffect(() => {
        const fetchData = async () => {
            try {
                const response = await axios.post('https://www.zoelindev.com/moneyCatBackend/typelist.php', {
                    email: sessionEmail,
                    startDate: localStorage.getItem("startDate"),
                    endDate: localStorage.getItem("endDate")
                });
                setCosts(response.data);
            } catch (error) {
                console.error(error);
            }
        };
        fetchData();
    }, [sessionEmail]);

    return (
        <div className="chartWrap">
            <Header />
            <div className="round3"></div>
            <h2>Monthly</h2>

            <div className="op">
                <Link to="/chart_spend" className="chartSpendBtn">
                    Spend /
                </Link>
                <Link to="/chart_income" className="chartIncomeBtn">
                    Income
                </Link>
            </div>

            <div className="top">
                <DateRangeForm email={sessionEmail} />
            </div>

            <div className="spendDetail">
                <Open title="Food" cost={cost['food']}>
                    <p>Hidden content for Food goes here</p>
                </Open>
                <Open title="Home" amount={costs['home']}>
                    <p>Hidden content for Home goes here</p>
                </Open>
                <Open title="Fun" amount={costs['fun']}>
                    <p>Hidden content for Fun goes here</p>
                </Open>
                <Open title="Travel" amount={costs['travel']}>
                    <p>Hidden content for Travel goes here</p>
                </Open>
                <Open title="Health" amount={costs['health']}>
                    <p>Hidden content for Health goes here</p>
                </Open>

                <Open title="Learn" amount={costs['learn']}>
                    <p>Hidden content for Learn goes here</p>
                </Open>
                <Open title="Shop" amount={costs['shop']}>
                    <p>Hidden content for Shop goes here</p>
                </Open>
                <Open title="Lend" amount={costs['lend']}>
                    <p>Hidden content for Lend goes here</p>
                </Open>
                <Open title="Others" amount={costs['others']}>
                    <p>Hidden content for Others goes here</p>
                </Open>
            </div>
        </div>
    );
}

export default ChartSpend;
